Information
------------------------------

Chasing Rhinos
Join entertainment reporter Billy Bush in an awe-inspiring adventure as he takes time off from his day job to fight illegal poaching of greater one-horned rhinos. He'll accompany poaching patrols; fly an unmanned aerial drone; and participate in a race-against-time effort to catch, collar and release a wild adult rhino.
Greater one-horned rhinos are being poached, even within the borders of protected national parks guarded by armed rangers. Just over 500 of these 12-foot-long, 3-ton living tanks survive in Nepal to this day, and their numbers are threatened due to poachers who are willing to profit at the rhinos' expense. A single rhino horn can fetch more than $30,000 on the black market, which is reason enough for poachers to slaughter this rare, beautiful and powerful species.
&quot;We have an opportunity to do something really remarkable, and that is to raise some awareness. Most people I told about this mission said, 'there's rhinos in Nepal?'&quot; said Bush

